import React from 'react';


export default function Index() {
    return (
      <div>
          <section class="header">
          </section>
        <p>Hello Next.js</p>
        <style jsx>{`
            section,
             {
                width: 100vw;
                height: 25vh;
                background-color: blue;
            }
         `}</style>
      </div>
    );
  }
